import {Link,Switch,Route} from 'react-router-dom';
import {useEffect, useState} from 'react';
import {useHistory} from "react-router-dom"
import Header from './header';
import Footer from './footer';
import Home from './home';
import Login from './login';
import DisplayPg from './displaypg';




function Launcher()
{
    var [user,setUser] = useState("");
    var history = useHistory();

    useEffect(()=>{
       var username = sessionStorage.getItem('username');
       if(username!=null && username!="")
       {
              setUser(username);
       } 
       else{
              setUser("Guest");
       }
    },[])

    return <>
            <hr></hr>
            <Header></Header>
            <hr></hr>
            <div style={{padding: 20}}>
                <Link to="/home">Home</Link> | {" "}
                <Link to="/displaypg">DisplayPg</Link> | {" "}
                <Link to="/addowner">AddOwner</Link> | {" "}
                {/* <Link to="/deleteowner">DeleteOwner</Link> | {" "} */}
                <button type="button" class="btn btn-success" Link to="/deleteowner">Login</button>
                <Link to="/login">Login</Link> | {" "}
                Welcome Admin{"  "}{user}
            </div>
            <hr></hr>
            <Switch>
                    <Route exact path='/home'
                           component={Home}></Route>        
                    <Route exact path='/login'
                            component={Login}></Route>
                     <Route exact path='/displaypg'
                            component={DisplayPg}></Route>

            </Switch>
            <hr></hr>
            <Footer></Footer>
            <hr></hr>
        </>
}

export default Launcher;
